import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="navigation">
        <div className="brand">
          <a           className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer">Niyumi</a>
        </div>
    </div>
  );
}

export default App;
